post_text:
A note from PTO President, Amy Suchan;
Due to the executive order from the governor we have had to cancel our saykllys egg order. If you have any question please contact me directly. I will be working on getting all of the orders together and getting money back to everyone when I can.

If you need the money back right away please private message me your address and I will do what I can to get it to you.

